import {ServiceComponent} from '../serviceComponent'
export const VoteComponent = ({services=[]})=>{
    console.log(services);
    return(
        <div>
            <ul>{services.map((vote)=>{
                return(
                    <div>
                        <li key={vote.id}>{vote.votes}</li>

                    </div>
                )
            })}</ul>
        </div>
    );
}
